snippet.textDisplay:
If you are prepared to ignore 'faith faith faith' vibe in this song (the part 'main tumse pyaaar kara tha and all'  sounds like 'Maybe You mean every word you say Can't help but think of yesterday), you will like it because the music that is 'composed' by Ali Zafar and 'directed' by Shani arshad is ok but yes absolute third class lyrics at work. Long ago, Cokestudio used to be about music. This season so far, it is about weird gesticulating, mistaking the setting for a concert and being too self aware. That's just about it. Long ago, you had to earn being in the studio, now it is - 'dekho baba ko guitar bajana bhi aata hai'

Love from India

@Rohwit

